import React, { useState, useContext, useEffect } from "react";
import { auth, db } from "../../base";
import { signOut } from "firebase/auth";
import { AuthContext } from "../../AuthProvider";
import { useNavigate } from "react-router-dom";
import { ReactEmbeddedGoogleCalendar } from 'react-embedded-google-calendar';
import PageHeader from "../../components/PageHeader/PageHeader";
import AnnouncementList from "../../components/AnnouncementsList/AnnouncementList";
import Navbar from "../../components/Navbar/Navbar";

function Home() {
  const { currentUser } = useContext(AuthContext);
  const navigate = useNavigate();


  const clickLogin = () => {
    if (currentUser) {
      signOut(auth);
    } else {
      navigate("/login");
    }
  };

  const clickSignup = () => {
    navigate("/signup");
  };

  return (
    <div className="mainContainer">

      {currentUser && console.log("authenticated")}
      <div>
        <button onClick={clickLogin}>
          {currentUser ? "Log Out" : "Log In"}
        </button>
      </div>
      <PageHeader />
        <Navbar />
        <div className="announcements">
          <AnnouncementList />
        </div>
        <div className="calendar">
        <ReactEmbeddedGoogleCalendar publicUrl="https://calendar.google.com/calendar/embed?height=600&wkst=1&bgcolor=%230B8043&ctz=America%2FNew_York&showPrint=1&title=Christina's%20Calendar&src=Y2hyaXN0aW5hYWxwZXJpQGdtYWlsLmNvbQ&color=%2333B679" width='400px' height='400px'></ReactEmbeddedGoogleCalendar>
      </div>
    </div>
  );
}

export default Home;
